        "title": "God Of War Ragnarök | Exclusive Cover Reveal Trailer",
        "description": "God of War Ragnarök is set to conclude the Norse era of the series, a saga that’s seen Kratos atone for his troubling past by becoming a more conscientious god and (mildly) affectionate father. In the upcoming sequel, Kratos and Atreus must stave off a preordained catastrophe, calling on old and new friends to succeed against Asgard and, hopefully, prevent all-out war.  \n\nI spoke with God of War veteran and newly appointed director Eric Williams and some lead UX, combat, and level designers about their experience crafting the long-awaited sequel and the most significant changes coming to the action and exploration loops. Moreover, you’ll learn about Kratos’ tools/toys, a never-before-seen dwarven realm that feels lived in, the unprecedented number of accessibility features available at launch, and some quality-of-life updates, including new navigation mechanics.\n\nOf course, that’s not all. We’ve got other God of War content for your perusal, including a ranking of our five favorite bosses from the franchise. Additionally, Alex Van Aken attended Evo, favorably comparing the storied event to the Olympics. Marcus Stewart got hands-on time with the next entry in the most prominent fighting franchise of all time, Street Fighter 6. There are even a few fantastic freelance pieces – one, for instance, documents the meticulous creation of a Cuphead boss fight. And if you’re wondering what big games are on the horizon, we’ve got you covered with preview pages dedicated to Square Enix’s role-playing farming sim, Harvestella, Game Freak’s Pokémon Scarlet and Violet, and so much more.  \n\n// S U B S C R I B E\nDon't miss any of our video features or exclusive coverage!\nSubscribe to the channel: https://www.YouTube.com/GameInformer?sub_confirmation=1\n\n// FOLLOW US ON SOCIAL\nTwitter | https://www.twitter.com/GameInformer\nInstagram | https://www.instagram.com/GameInformerMagazine\nFacebook | https://www.facebook.com/officialgameinformer/\n\n// READ